import React, { Component } from 'react';
import './Weather.css';

class Weather extends Component{
    render(){
        return(
            <div className="weather-container">
                <div className="weather">
                    날씨
                </div>
                <div className="dust">
                    미세먼지
                </div>
            </div>
        )
    }
};

export default Weather;
